import './App.css';

function App() {
  return (
    <div className="wrapper">
      {/* Header Start */}
      <header>
        Header
      </header>
      {/* Header End */}

      {/* Main Start */}
      <main>
        Main
      </main>
      {/* Main End */}

      {/* Footer Start */}
      <footer>
        Footer
      </footer>
      {/* Footer End */}

    </div>
  );
}

export default App;
